import './UserList.css';

const UserList =(props)=>{
       
    return(
        
        <ul>
            {
                props.name_age_array.map((each_user) =>(
                     <li> {each_user.name} {each_user.age} </li>
                 ))

            }
        </ul>
    );
}

export default UserList;
